    from the San Antonio Police Association and correctly included the total amount
    received during the period on Line 11(a)(ii) of the Detailed Summary Page.  Accordingly,
    both items raised in the Commission's Request for Additional Information, dated
    April 30, 2008, have now been corrected.  There are no other changes to the report."
